window.bookSummaryJSON = "<p>Se7en Deadly SEALs can't save me now. </p> <p>6ix months I've wasted only to have my secret discovered. </p> <p>5ive days since I met the little boy I can't stop thinking about. </p> <p>4our minutes I've sat in silence since I learned my gig was up. </p> <p>Thre3 times I've seen my brother behind bars. </p> <p>2wo years since I said goodbye to my baby. </p> <p>1ne amazing night of ecstasy with my soul mate. </p> <p>Zer0 idea what Grant will do to me now that he knows I lied. </p> <p>After years apart, Grant and I finally made love again. It was intoxicating, the perfect blend of pleasure and passion. But now that he knows my secret, I'm at his mercy. I'm addicted to him - I didn't anticipate the bond between us to be so carnal. </p>"; 
